    const flattenedData = ref([]); // Data detail yang sudah diproses (Array of Item Opname)
    const loading = ref(false);
    const errorMessage = ref("");
    const token = localStorage.getItem("token");

    /**
     * FIX MAPPING: Menggunakan struktur data DETAIL yang dikembalikan oleh /history/stock-opnames
     * (Asumsi: Mengembalikan array of Header Opname, dengan 'details' di dalamnya)
     * @param {Array} opnames - Array of Stock Opname Headers
     * @returns {Array} Array of flattened Stock Opname Items
     */
    const flattenReportData = opnames => {
      const flattened = [];
      // Iterasi melalui Header Stok Opname
      opnames.forEach(opnameHeader => {
        // Mengambil details, asumsi properti di backend adalah 'details'
        const items = opnameHeader.details || [];

        // Ambil data dari header
        const opnameDate = opnameHeader.date ? opnameHeader.date.substring(0, 10) : "N/A";

        // Iterasi melalui Item Detail Opname
        items.forEach(item => {
          // ✅ KUNCI FIX QTY: Membaca properti dengan Case yang benar (S besar)
          const system = item.systemStock || 0;
          const physical = item.physicalStock || 0;

          // Ambil nama produk dari item.product.name
          const productName = item.product?.name || item.productName || "N/A";
          const productCode = item.product?.productCode || item.productCode || "-";
          flattened.push({
            date: opnameDate,
            book_name: productName,
            product_code: productCode,
            system_stock: system,
            physical_stock: physical,
            difference: physical - system
          });
        });
      });
      return flattened;
    };

    // Ambil data dari backend
    const fetchData = async () => {
      loading.value = true;
      errorMessage.value = "";
      try {
        if (!token) {
          errorMessage.value = "Token autentikasi tidak ditemukan. Silakan login kembali.";
          return;
        }

        // ✅ FIX ENDPOINT: Ganti ke endpoint DETAIL Riwayat (history) karena owner endpoint hanya ringkasan
        // Endpoint ini dapat diakses oleh Owner karena memiliki role yang memadai.
        const url = "http://localhost:8081/api/v1/history/stock-opnames";
        const res = await axios.get(url, {
