      const end = new Date(endDate);
      end.setDate(end.getDate() + 1); // Tambah 1 hari
      const endTime = end.setHours(0, 0, 0, 0);
      if (isNaN(start) || isNaN(endTime)) {
        return flattenedData.value;
      }

      // Lakukan filtering
      return flattenedData.value.filter(item => {
        // Tanggal item diubah menjadi timestamp tanpa waktu untuk perbandingan harian
        const itemDate = new Date(item.date).setHours(0, 0, 0, 0);
        return itemDate >= start && itemDate < endTime;
      });
    });
