        errorMessage.value = "Harap masukkan kedua tanggal (Dari dan Sampai) untuk memfilter.";
        return;
      }
      // Tidak perlu fetchData karena kita sudah fetch semua data di onMounted
      errorMessage.value = "";
    }
    function resetFilter() {
      filters.value.startDate = "";
      filters.value.endDate = "";
      errorMessage.value = "";
      // Tidak perlu fetchData lagi
    }
